 * @param       secretphrase
 * @param       pretty
 * @abstract    This script can be used in shared web hosting environments which do not allow execution of CLI commands to run Mautic cron and maintenance tasks.
 * @link        https://gist.github.com/escopecz/9a1a0b10861941a457f4
 * @see         https://www.mautic.org/docs/en/setup/cron_jobs.html
 * @see         https://johnlinhart.com/blog/uh-oh-mautic-upgrade-was-not-successful
 * @filesource  commands.php
 */

$secretphrase= "c3dXiEd0UmZ7";
if (!isset($_GET[$secretphrase])) {
    echo 'The secret phrase is wrong.';
    die;
}
defined('IN_MAUTIC_CONSOLE') or define('IN_MAUTIC_CONSOLE', 1);
$version = file_get_contents(__DIR__.'/app/version.txt');
// $pretty = $_GET['pretty'] ?? null;
if (isset($_GET["pretty"])) {
    $pretty = $_GET['pretty'];
}
$link = "http://$_SERVER[HTTP_HOST]$_SERVER[REQUEST_URI]";
$allowedTasks = array(
    'mautic:segments:update',
    'mautic:campaigns:update',
    'mautic:campaigns:trigger',
    'mautic:campaigns:messages',
    'cache:clear',
    'cache:clear --no-warmup',
    'cache:clear --no-interaction --no-warmup -vvv',
    'cache:warmup',
    'mautic:segments:rebuild',
    'mautic:campaigns:rebuild',
    'mautic:segments:update --force',
    'mautic:campaigns:update --force',
    'mautic:campaigns:trigger --force',
    'mautic:campaigns:update --batch-limit=25',
    'mautic:campaigns:trigger --batch-limit=25',
    'mautic:messages:send',
    'mautic:queue:process',
    'mautic:emails:send',
    'mautic:email:fetch',
    'swiftmailer:debug',
    'mautic:broadcasts:send',
    'mautic:iplookup:download',
    'mautic:social:monitoring',
    'social:monitor:twitter:hashtags',
    'social:monitor:twitter:mentions',
    'mautic:plugins:update',
    'mautic:import',
    'mautic:reports:scheduler',
    'mautic:update:find',
    'mautic:webhooks:process',
    'mautic:assets:generate',
    'mautic:integration:pushactivity',
    'mautic:integration:pushleadactivity',
    'mautic:integration:synccontacts',
    'mautic:maintenance:cleanup --days-old=90 --dry-run',
    'mautic:maintenance:cleanup --days-old=365 --dry-run',
    'mautic:maintenance:cleanup --days-old=90 --no-interaction',
    'mautic:maintenance:cleanup --days-old=365 --no-interaction',
    'doctrine:migration:status',
    'doctrine:migrations:migrate',
    'doctrine:schema:update --dump-sql',
    'doctrine:schema:update --force',
    'mautic:update:apply --force',
    'mautic:install:data'
);
  // region logo_base64
    $logo_base64 = "";
  // region logo_base64 end

if (!isset($_GET['task'])) {
    echo '<html><head>';
    if (isset($pretty)) {
        echo '</head><body style="font-family: Open Sans, Helvetica, Arial, sans-serif;">';
        echo '<p><a target="new" href="/s/login"><img src="data:image/jpeg;base64, ' . $logo_base64 . '" alt="base64_encoded_logo"></a></p>';
    } else {
        echo '</head><body>';
    }
    echo '<p>Specify what task to run. You can run these:';
    echo '<ul>';
    foreach ($allowedTasks as $task) {
        $href = $link . '&task=' . urlencode($task);
        echo '<li><a href="' . $href . '">' . $task . '</a></li>';
    }
    echo '</ul><br/>Mautic <a href="https://www.mautic.org/docs/en/setup/cron_jobs.html">cronjob doco</a> and <a href="https://johnlinhart.com/blog/uh-oh-mautic-upgrade-was-not-successful">Upgrade troubleshooting</a>';
    if (isset($version)) {
        echo '<p><small>Mautic version: <b style="color:blue">' . $version . '</b></small></p>';
    }
    echo '<hr>';
    echo '<b style="color:red">Please, backup your database before executing the doctrine commands!</b></p>';
    die;
}

$task = urldecode($_GET['task']);
if (!in_array($task, $allowedTasks)) {
    echo 'Task ' . $task . ' is not allowed.';
    die;
}
if (isset($pretty)) {
    $options = ' --ansi';
} else {
    $options = '';
}
$fullCommand = explode(' ', $task);
$command = $fullCommand[0];
$argsCount = count($fullCommand) - 1;
$args = array('console'.$options, $command);
if ($argsCount) {
    for ($i = 1; $i <= $argsCount; $i++) {
        $args[] = $fullCommand[$i];
    }
}
echo '<html><head>';
if (isset($pretty)) {
    echo '<style type="text/css">
    a { display:block;
        width:32px;
        height:32px;
        text-align:center;
        background-color:blue;
        border:1px solid #000000;
    }
    </style>';
    echo '</head><body style="font-family: Open Sans, Helvetica, Arial,sans-serif;">';
    echo '<p><img src="data:image/jpeg;base64, ' . $logo_base64 . '" alt="base64_encoded_logo"></p>';
} else {
    echo '</head><body>';
}
echo '<h3>Executing ' . implode(' ', $args) . '</h3>';

require_once __DIR__.'/app/autoload.php';
require_once __DIR__.'/app/AppKernel.php';
require __DIR__.'/vendor/autoload.php';
use Symfony\Bundle\FrameworkBundle\Console\Application;
use Symfony\Component\Console\Input\ArgvInput;
use Symfony\Component\Console\Output\BufferedOutput;

try {
    $input  = new ArgvInput($args);
    $output = new BufferedOutput();
    $kernel = new AppKernel('prod', false);
    $app    = new Application($kernel);
    $app->setAutoExit(false);
    $result = $app->run($input, $output);
    echo "<pre>\n" . $output->fetch() . '</pre>';
} catch (\Exception $exception) {
    echo "Exception raised: " . $e->getMessage() . "\n";
} finally {
    if (isset($pretty)) {
        echo '<p><a href="javascript:history.back(1)" title="Return to the previous page">&laquo; Go back</a></p>';
    }
    echo '</body></html>';
}
